--
-- Name: enc_sha512(character varying); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION enc_sha512(p_val character varying) RETURNS character varying
    LANGUAGE sql
    AS $$
SELECT encode(digest(p_val, 'sha512'), 'hex');
$$;


ALTER FUNCTION paragon.enc_sha512(p_val character varying) OWNER TO paragon;

--
-- Name: exists_by_pk(character varying, bigint); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION exists_by_pk(p_table_name character varying, p_id bigint) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
DECLARE
  c int;
BEGIN
  EXECUTE 'SELECT count(*) FROM ' || quote_ident(p_table_name)::regclass || ' WHERE id=$1'
  USING p_id 
  INTO c;
  
  IF c = 0 THEN
  	RETURN false;
  END IF;
  
  RETURN true;
EXCEPTION
	WHEN OTHERS THEN
 	  RETURN false;
END;
$_$;


