--
-- Name: f_artificial_biu_trg(); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION f_artificial_biu_trg() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (TG_OP = 'INSERT') THEN
    	IF NEW.id IS NULL THEN
        	NEW.id := nextval('artificial_seq');
            NEW.version := 1;
        END IF;
    ELSIF (TG_OP = 'UPDATE') THEN
 		IF((NEW.name != OLD.name) OR (NEW.body_type_id != OLD.body_type_id) OR 
           (NEW.semi_major_axis != OLD.semi_major_axis) OR
           (NEW.rotational_period != OLD.rotational_period) OR (NEW.star_system_id != OLD.star_system_id) OR
           (NEW.docks_count != OLD.docks_count)
          ) THEN
        	NEW.version := NEW.version + 1;
        END IF;
    END IF;

	RETURN NEW;
END;
$$;


