            (NEW.radius != OLD.radius) OR (NEW.surface_temperature != OLD.surface_temperature) OR 
            (NEW.semi_major_axis != OLD.semi_major_axis) OR (NEW.orbital_eccentricity != OLD.orbital_eccentricity) OR
            (NEW.inclination != OLD.inclination) OR (COALESCE(NEW.axial_tilt,-1) != COALESCE(OLD.axial_tilt,-1)) OR 
            (NEW.rotational_period != OLD.rotational_period) OR (COALESCE(NEW.metallicity,-1) != COALESCE(OLD.metallicity,-1)) OR 
            (COALESCE(NEW.volcanicity,-1) != COALESCE(OLD.volcanicity,-1)) OR  
            (COALESCE(NEW.atmos_density,-1) != COALESCE(OLD.atmos_density,-1)) OR 
            (COALESCE(NEW.atmos_oxidizing,-1) != COALESCE(OLD.atmos_oxidizing,-1)) OR 
            (COALESCE(NEW.ocean_cover,-1) != COALESCE(OLD.ocean_cover,-1)) OR 
            (COALESCE(NEW.ice_cover,-1) != COALESCE(OLD.ice_cover,-1)) OR
            (COALESCE(NEW.life,-1) != COALESCE(OLD.life,-1)) OR  
            (COALESCE(NEW.rotational_phase_at_start,-1) != COALESCE(OLD.rotational_phase_at_start,-1)) OR
            (COALESCE(NEW.orbital_phase_at_start,-1) = COALESCE(OLD.orbital_phase_at_start,-1)) OR 
            (COALESCE(NEW.orbital_offset,0) != COALESCE(OLD.orbital_offset,0)) OR     
            (COALESCE(NEW.height_map,'x') != COALESCE(OLD.height_map,'x')) OR 
            (COALESCE(NEW.height_map_fractal,-1) != COALESCE(OLD.height_map_fractal,-1)) OR
            (NEW.seed != OLD.seed) OR (COALESCE(NEW.ring_status_id,-1) != COALESCE(OLD.ring_status_id,-1)) OR
            (COALESCE(NEW.ring_inner_radius,-1) != COALESCE(OLD.ring_inner_radius,-1)) OR
            (COALESCE(NEW.ring_outer_radius,-1) != COALESCE(OLD.ring_outer_radius,-1)) OR
            (NEW.star_system_id != OLD.star_system_id) OR (NEW.periapsis != OLD.periapsis) OR
            (NEW.apoapsis !- OLD.apoapsis) OR (NEW.has_atmosphere != OLD.has_atmosphere) OR
            (NEW.is_scoopable != OLD.is_scoopable)
           ) 
        THEN
        	NEW.version := OLD.version + 1;
        END IF;
    END IF;

	RETURN NEW;
END;
$$;


ALTER FUNCTION paragon.f_stellar_biu_trg() OWNER TO paragon;

