CREATE FUNCTION get_body_type_id_from_code(p_code character varying) RETURNS smallint
    LANGUAGE plpgsql
    AS $$
DECLARE
  cur CURSOR FOR
  SELECT id
  FROM body_type
  WHERE code = p_code;
  l_id SMALLINT;
BEGIN
  OPEN cur;
  FETCH cur INTO l_id; 
  CLOSE cur;

  RETURN l_id;
END;
$$;


