--

CREATE FUNCTION get_player_id_from_name(p_player_name_in character varying) RETURNS bigint
    LANGUAGE plpgsql
    AS $$
DECLARE
  l_id BIGINT DEFAULT -1;
  l_get_player_id_cur CURSOR FOR
	SELECT p.id
    FROM player p
    WHERE p.name = p_player_name_in;
BEGIN
  OPEN l_get_player_id_cur;
  FETCH l_get_player_id_cur INTO l_id;
  CLOSE l_get_player_id_cur;

  RETURN COALESCE(l_id, -1);
EXCEPTION
	WHEN OTHERS THEN
  		RETURN l_id;
END;
$$;


