--
-- Name: get_star_system_obj_from_path(integer, integer, integer, integer, integer); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION get_star_system_obj_from_path(p_sector_x integer, p_sector_y integer, p_sector_z integer, p_system_index integer, p_body_index integer) RETURNS bigint
    LANGUAGE plpgsql
    AS $$
DECLARE
  cur CURSOR FOR
  SELECT sso.id
  FROM star_system ss, star_system_obj sso
  WHERE ss.sector_x = p_sector_x
    AND ss.sector_y = p_sector_y
    AND ss.sector_z = p_sector_z
    AND ss.sector_serial_no = p_system_index 
    AND sso.star_system_id = ss.id
    AND sso.serial_no = p_body_index;
  l_id BIGINT;
BEGIN
  OPEN cur;
  FETCH cur INTO l_id; 
  CLOSE cur;

  RETURN COALESCE(l_id, -1);
END;
$$;


