--
-- Name: player_savegame_get(); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION player_savegame_get() RETURNS bytea
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  l_savegame BYTEA;
  l_player_id BIGINT;
  l_player_name VARCHAR(1000);
  l_get_player_savegame_cur CURSOR FOR
	SELECT ps.payload_bin
    FROM player_savegame ps
    WHERE ps.player_id = l_player_id;
BEGIN
  -- Get the Player Identify.
  l_player_name := session_user;
  l_player_id := get_player_id_from_name(l_player_name);
  IF l_player_id < 0 THEN
    l_savegame := NULL;
    RETURN l_savegame;
  END IF;
  
  -- Get the savegame for the player
  OPEN l_get_player_savegame_cur;
  FETCH l_get_player_savegame_cur INTO l_savegame;
  CLOSE l_get_player_savegame_cur;
  
  RETURN l_savegame;
EXCEPTION
	WHEN OTHERS THEN
  		l_savegame := NULL;
  		RETURN l_savegame;
END;
$$;


ALTER FUNCTION paragon.player_savegame_get() OWNER TO paragon;

--
-- Name: player_savegame_set(bytea); Type: FUNCTION; Schema: paragon; Owner: paragon
--

CREATE FUNCTION player_savegame_set(p_savegame_in bytea) RETURNS integer
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  l_result INTEGER DEFAULT 0;
  l_player_id BIGINT;
  l_player_name VARCHAR(1000);
BEGIN
   -- Don't save empty savegame!
   IF p_savegame_in IS NULL THEN
  		l_result := -2;
        RETURN l_result;
   END IF;	
   
  -- Get Player's Identity from the name.
  l_player_name := session_user;
  l_player_id := get_player_id_from_name(l_player_name);
  IF l_player_id < 0 THEN
		l_result := -3;
        RETURN l_result;
  END IF;	  	
  
  -- Save the new savegame onto the old one.
  UPDATE player_savegame 
  SET payload_bin = p_savegame_in
  WHERE player_id = l_player_id;
  IF NOT FOUND THEN
  	INSERT INTO player_savegame(player_id, payload_bin)
    VALUES(l_player_id, p_savegame_in);
  END IF;
  
  RETURN l_result;
END;
$$;


ALTER FUNCTION paragon.player_savegame_set(p_savegame_in bytea) OWNER TO paragon;

