--
-- Name: star_system_obj_lov_v; Type: VIEW; Schema: paragon; Owner: paragon
--

CREATE VIEW star_system_obj_lov_v AS
    SELECT a.id, a.version, a.star_system_id, a.star_system_name, a.serial_no, a.orbits_id, st.name AS orbits_name, a.stellar_id, s.name AS stellar_name, a.artificial_id, ar.name AS artificial_name FROM ((((SELECT sso.id, sso.version, sso.star_system_id, ss.name AS star_system_name, sso.serial_no, sso.orbits_id, sso.stellar_id, sso.artificial_id FROM star_system_obj sso, star_system ss WHERE (sso.star_system_id = ss.id)) a LEFT JOIN stellar s ON ((a.stellar_id = s.id))) LEFT JOIN artificial ar ON ((a.artificial_id = ar.id))) LEFT JOIN stellar st ON ((a.orbits_id = st.id)));


