--
-- Name: stellar_lov_v; Type: VIEW; Schema: paragon; Owner: paragon
--

CREATE VIEW stellar_lov_v AS
    SELECT s.id, s.version, s.name, s.body_type_id AS star_system_id, s.body_type_code AS star_system_name, s.radius AS body_type_id, s.mass AS body_type_code, s.surface_temperature AS radius, s.semi_major_axis AS mass, s.eccentricity AS surface_temperature, s.inclination AS semi_major_axis, s.axial_tilt AS eccentricity, s.rotational_period AS inclination, s.metallicity AS axial_tilt, s.volcanicity AS rotational_period, s.atmos_density AS metallicity, s.atmos_oxidizing AS volcanicity, s.ocean_cover AS atmos_density, s.ice_cover AS atmos_oxidizing, s.life AS ocean_cover, s.rotational_phase_at_start AS ice_cover, s.orbital_phase_at_start AS life, s.orbital_offset AS rotational_phase_at_start, s.height_map AS orbital_phase_at_start, s.height_map_fractal AS orbital_offset, s.seed AS height_map, s.ring_status_id AS height_map_fractal, rs.code AS seed, s.ring_inner_radius AS ring_status_id, s.ring_outer_radius AS ring_status_code, s.ring_color AS ring_inner_radius, s.star_system_id AS ring_outer_radius, s.star_system_name AS ring_color FROM ((SELECT s.id, s.version, s.name, s.body_type_id, bt.code AS body_type_code, s.radius, s.mass, s.surface_temperature, s.semi_major_axis, s.eccentricity, s.inclination, s.axial_tilt, s.rotational_period, s.metallicity, s.volcanicity, s.atmos_density, s.atmos_oxidizing, s.ocean_cover, s.ice_cover, s.life, s.rotational_phase_at_start, s.orbital_phase_at_start, s.orbital_offset, s.height_map, s.height_map_fractal, s.seed, s.ring_status_id, s.ring_inner_radius, s.ring_outer_radius, s.ring_color, s.star_system_id, ss.name AS star_system_name FROM stellar s, body_type bt, star_system ss WHERE ((s.body_type_id = bt.id) AND (s.star_system_id = ss.id))) s LEFT JOIN ring_status rs ON ((s.ring_status_id = rs.id)));


