1	1	Solitary	The most common, these systems consist of one star and a number of orbiting planets, such as Sol and Achenar. Oddly, there are never any true solitary stars, as each has a system of planets in orbit around it.
2	1	Binary	Two stars in orbit around a common center of mass. Sirius is a good example, there are many binary systems in the universe, these tend not to have life-supporting planets in orbit, although there are a few. This could be because of the intense radiation from both stars (especially if one is a white dwarf) and the eccentric orbit a planet must have: if it has to orbit in a figure of eight it will eventually be ripped apart by the sheer gravitational forces it encounters. Most planets tend to orbit one star only.
3	1	Ternary	Same as binary except three stars are involved. Orbits tend to vary, usually it is like a binary system with the additional star acting like a 'satellite'.
4	1	Quarternary	Two binary systems, one orbiting the other.
5	1	Quintuple	It is actually a Quarternary with additional 'satellite' star.
6	1	Sextuple	Three binary systems, one orbiting the other.
